import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import { green } from '@material-ui/core/colors';
import Radio, { RadioProps } from '@material-ui/core/Radio';
import { RadioButtan } from 'src/interfaces/RadioButton';

type Props = {
  radioButtanList: RadioButtan[]
}
const GreenRadio = withStyles({
  root: {
    color: green[200],
    '&$checked': {
      color: green[400],
    },
  },
  checked: {},
})((props: RadioProps) => <Radio color="default" {...props} />);

export default function RadioButtons({ radioButtanList }: Props) {
  const [selectedValue, setSelectedValue] = React.useState('a');

  const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSelectedValue(event.target.value);
  };

  return (
    <div>
      {Object.keys(radioButtanList).map((name, value) => (
        <GreenRadio
          key={name}
          checked={selectedValue === ''}
          onChange={handleChange}
          value={value}
          name="radio-button-demoeee"
          inputProps={{ 'aria-label': 'A' }}
        />
      ))};
    </div>
  );
}
